
public class LocationQueue {
private int x;
private int y;
	public LocationQueue(int x , int y) {
		// TODO Auto-generated constructor stub
		this.x=x;
		this.y=y;
	}
	public int getX() {
		return x;
	}
	public int getY() {
		return y;
	}
	public void setX(int x) {
		this.x=x;
	}
	
	public void setY(int y) {
		this.y=y;
	}


}
